  false,\n\t\"url\": null,\n\t\"notes\": \"This resource is available as a downloadable
  file, ESRI Service, and as a Web Feature service.  Resource includes seven plates
  with downloadable images:  Plate I: Surficial Material, Plate II: Bedrock Geology,
  Plate III: Ground Water Potential, Plate IV: Solid Waste Disposal Conditions, Plate
  V: Septic Tank Conditions, Plate VI: General Construction Conditions, Plate VII:
  Sand and Gravel Reserves.  Resource also includes text on Environmental planning
  for the Rutland-Brandon Region, Vermont.  For more information see links provided.
  nnThe Rutland-Brandon region was selected for the second study because of its present
  population, the projected growth during the next decade and the complex nature of
  the geology. The region encompasses four topographic quadrangles, namely, the Rutland,
  Brandon, Castleton and Rochester.\",\n\t\"license_title\": null,\n\t\"extras\":
